import React from 'react';

const ColoredBox = ({ height, width, backgroundColor }) => {
  const boxStyle = {
    height: height,
    width: width,
    backgroundColor: backgroundColor,
  };

  return <div style={boxStyle}></div>;
};

export default ColoredBox;
